  const classes = useStyles();
  return (
    <div>
      <img src={movie.imageUrl} className={classes.img} />
      <div className={classes.innerContainer}>
        <h3>asdfasf</h3>
      </div>
    </div>
  );
};

const useStyles = makeStyles((theme) => ({
  img: {
    width: "100%",
    position: "absolute",
    zIndex: 0,
